import React, { ReactElement } from 'react';
import { RouteComponentProps } from '@reach/router';

import { Head } from '@/components/common';
import { Layout } from '@/components/layouts';
import laptopImageSrc from '@/assets/images/laptop.png';
import './styles.scss';

function HomePage(props: RouteComponentProps): ReactElement {
  return (
    <Layout>
      <Head
        title="Home Page"
        description="General content about the site"
      />
      <main>
        <section className="home-page__introduction-container">
          <img
            className="home-page__introduction-image"
            src={laptopImageSrc}
            alt="People on the laptop"
          />
          <h3 className="home-page__introduction-title">
            Learn Your<br />Favorite Course<br />From Online
          </h3>
        </section>
      </main>
    </Layout>
  );
}

export default HomePage;
